Storyline:

     During World War II, tug boats conduct what are called salvage missions - picking up disabled ships. Not well equipped with weaponry, the tugs are sitting ducks for enemy fire. As such, the crew working the tugs have precarious lives, many with deep seated emotional problems. Before the Americans join the war, ex-American military man David Ross is assigned to captain a tug for the British military. He is shown the ropes by an old friend, Captain Chris Ford.


